    a specific candidate. The candidate name is noted and the date of transmittal
    to each candidate is noted.  The matching transmittal checks are itemized on line
    23.   All contributions noted as CONDUIT are contributions received for specific
    candidates and forwarded directly to each recipient committee. These were not
    deposited by the Senate Conservatives Fund.  All contributors aggregating over
    $200 calendar year to date with incomplete employer/occupation have received requests
    for additional information.   Per instructions from the FEC, the adjusting entry
    on line 21b balances the IE payments made to Senate Conservatives Fund for CC
    processing fees.  As directed by the FEC, the memo entries to Senate Conservatives
    Fund on Schedule E are not debt owed by the Committee, but disclose the use of
    the SCF email list as there is no direct cost to SCF. \n"
